import Item from "./Item";
import React from "react";
import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const ItemList = (data) => {
    console.log("Estos son los productos", data.elements)

    const laRopa = data.elements

    const task = new Promise((res, rej) => {
        setTimeout(() => {
            res()
            console.log("hola tarde 8 segundos")
        }, 2000)
    })
    task.then(result => {
        retornar()
    })
    task.catch(err => {
        console.log("esto es el error", err)
    })

    const retornar = () => {

        return (
            <Row className="justify-content-md-center">
                {laRopa.map((data) => (
                    <Col md="4" mb="2">
                        <Item prenda={data} />
                    </Col>
                ))}
            </Row>
        )
    }

}
export default ItemList;
